import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { PropertyList } from './components/propertylist';
import { PropertyDetail } from './components/propertydetail';
import { Navigation } from './components/navigation';
import { Header } from './components/header';
import { Features } from './components/features';
import { About } from './components/about';
import { Services } from './components/services';
import { Gallery } from './components/gallery';
import { WhatToExpect } from './components/whattoexpect';
import { Team } from './components/Team';
import { Contact } from './components/contact';
import JsonData from './data/data.json';
import SmoothScroll from 'smooth-scroll';
import './App.css';
import { useEffect, useState } from 'react';

export const scroll = new SmoothScroll('a[href*="#"]', {
  speed: 1000,
  speedAsDuration: true,
});

const App = () => {
  const [landingPageData, setLandingPageData] = useState({});

  useEffect(() => {
    setLandingPageData(JsonData);
  }, []);

  return (
    <Router>
      <div>
        {/* Navigation Bar will remain visible across all pages */}
        <Navigation />

        {/* Routes to manage different pages */}
        <Routes>
          {/* Home Page with multiple sections */}
          <Route
            path="/"
            element={
              <>
                <Header data={landingPageData.Header} />
                <Features data={landingPageData.Features} />
                <About data={landingPageData.About} />
                <Services data={landingPageData.Services} />
                <PropertyList data={landingPageData.PropertyList} />
                <Gallery data={landingPageData.Gallery} />
                <WhatToExpect data={landingPageData.Whattoexpect} />
                <Team data={landingPageData.Team} />
                <Contact data={landingPageData.Contact} />
              </>
            }
          />

          {/* Route for Property Detail page */}
          <Route
            path="/property/:id"
            element={<PropertyDetail />}
          />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
